import '.'; // Asegúrate de importar el archivo CSS

const ProductCard = () => {
  return (
    <div className="product-card">
      <img src="path/to/your/image/burbuja.jpg" alt="Burbuja Poderosa" className="product-image" />
      <h2 className="product-name">Burbuja Poderosa</h2>
      <button className="buy-button">Comprar Ahora</button>
    </div>
  );
};

export default ProductCard;
